import React from 'react';

function Maximize({ color }) {

    return (
        <svg width="15px" height="15px">
            <g>
                <polyline fill={color} points="3,3.81 11.19,3.81 11.19,9.996" />
                <polyline fill={color} points="10.081,11.104 3.896,11.104 3.896,4.918" />
            </g>
        </svg>
    );
}

export default Maximize;
